import React from 'react';
import {GoogleMap,withScriptjs,withGoogleMap} from "react-google-maps"

function Map(){
    return (<GoogleMap defaultZoom={10} defaultCenter={{lat: 13.082680, lng:80.270721}} />)
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

const Search = () => (<div><WrappedMap googleMapURL= "https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places" loadingElement={<div style={{ height: `100%` }}/>}  containerElement={<div style={{ height: `400px` }} />} mapElement={<div style={{ height: `100%` }} />} /></div>);

export default Search;
